import React from 'react'

class Floor extends React.Component {

    render() {
        let allFloors = this.props.allFloors.map(x => (
            <li key={x}>
                <span 
                    className={x == this.props.floor ? 'checked' : 'unchecked'}
                    onClick={() => { this.props.handleChangeFloor(x)}}
                >
                    {x}
                </span>
            </li>))
        return (
            <form id='floor'>
                <ul>
                    {allFloors}
                </ul>
            </form>)
    }
}

export default Floor
